package com.jsp.footmap.model;import java.util.Date;public class Share {    private int sid;    private int uid;    private String subject;    private Date sendTime;    private int status;    private String contents;    private int likeCount;    private int disLikeCount;    private int commentCount;    public int getSid() {        return sid;    }    public void setSid(int sid) {        this.sid = sid;    }    public int getUid() {        return uid;    }    public void setUid(int uid) {        this.uid = uid;    }    public String getSubject() {        return subject;    }    public void setSubject(String subject) {        this.subject = subject;    }    public Date getSendTime() {        return sendTime;    }    public void setSendTime(Date sendTime) {        this.sendTime = sendTime;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getContents() {        return contents;    }    public void setContents(String contents) {        this.contents = contents;    }    public int getLikeCount() {        return likeCount;    }    public void setLikeCount(int likeCount) {        this.likeCount = likeCount;    }    public int getDisLikeCount() {        return disLikeCount;    }    public void setDisLikeCount(int disLikeCount) {        this.disLikeCount = disLikeCount;    }    public int getCommentCount() {        return commentCount;    }    public void setCommentCount(int commentCount) {        this.commentCount = commentCount;    }}